const Header = () => {
  return (
    <div className="header-container">
      <div className="logo-wrapper">LOGO</div>
      <div className="nav-wrapper">
        <ul>
          <li>
            <span>Products</span>
          </li>
          <li>
            <span>Solution</span>
          </li>
          <li>
            <span>Pricing</span>
          </li>
        </ul>
      </div>
      <div className="actions-wrapper" />
      <style jsx>
        {`
        .logo-wrapper {
            background-color:pink;
            border: 1px solid black; 
        }
        .nav-wrapper{
            background-color:pink;
            border: 1px solid black; 
            display: flex;

        }
        .nav-wrapper ul{
            list-style:none;
            padding:0;
            margin:0;
        }

        .actions-wrapper{
            background-color:pink;
            border: 1px solid black; 
        }
        .nav-wrapper{
            background-color:pink;
        }
        .header-container {
            width:100vw;
            height:100px;
            background-color: white;
            display: grid;
            grid-template-columns: repeat(3, 1fr);
            margin: auto;
            text-align: center;
        `}
      </style>
    </div>
  );
};

export default Header;
